import { useParams } from 'react-router-dom';
import '../ComponentsCss/ProductStatusTag.css';

function ProductStatusTag({productStatus}) {

    
    return(
        
        <div>
            {(()=> {
                switch (productStatus) {
                    case "active":
                        return(
<span className="statusTag border border-primary bg-primary rounded-pill">
                            Aktiv
                        </span>
                        )
                        
                        break;
                    case "sold":
                        <span className="statusTag border border-danger bg-danger rounded-pill">
                            Solgt
                        </span>
                        break;
                    default:
                        break;
                }
            })}
        </div>
    )
}

export default ProductStatusTag;
